import React from 'react';
import { Link } from 'react-router-dom';
import AddCustomer from './AddCustomer'
import './Menu.css';

class Menu extends React.Component{
  constructor(props)
  {
      super(props);
      this.state = {
          user: {}
      };
  }

  render(){
    const { user } = this.state;
    return (
        <div className="Menu">
          <header className="Menu-header">
            <h1>Box Tracker</h1>
            <p>Welcome, user</p>
          </header>
          <body className="Menu-body">
          <p1>Main Menu</p1>
            <Button to="/AddCustomer" className="btn btn-primary">Add Customer</Button>
          </body>
        </div>
      );
    }
  }
  

export default Menu;
